import React from 'react';

const Dashboard = ({ isLoading, stats, supabase }) => {
  if (isLoading) {
    return <div>Loading dashboard data...</div>;
  }

  return (
    <div className="dashboard-container">
      <h1>Dashboard</h1>
      {stats && (
        <div className="stats-grid">
          <div className="stat-card">
            <h3>Subscribers</h3>
            <p className="stat-value">{stats.subscriberCount}</p>
          </div>
          <div className="stat-card">
            <h3>Emails Sent</h3>
            <p className="stat-value">{stats.sentCount}</p>
          </div>
          <div className="stat-card">
            <h3>Open Rate</h3>
            <p className="stat-value">{stats.openRate}%</p>
          </div>
          <div className="stat-card">
            <h3>Click Rate</h3>
            <p className="stat-value">{stats.clickRate}%</p>
          </div>
          <div className="stat-card">
            <h3>Bounce Rate</h3>
            <p className="stat-value">{stats.bounceRate}%</p>
          </div>
        </div>
      )}
      <div className="last-updated">
        Last updated: {stats?.lastUpdated || 'Never'}
      </div>
    </div>
  );
};

export default Dashboard;
